import React, { useEffect, useState } from "react";
import Table from "react-bootstrap/Table";
import axios from "axios";

export default function Tenantdata() {
  const [tenants, setTenants] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);
    axios.get("http://localhost:8000/tenantdata").then((response) => {
      setTenants(response.data);
      setLoading(false);
    });
  }, []);

  return (
    <div className="App">
      <>
        <h1>Tenants</h1>
        <Table border={1}>
          <tr>
            <th>Tenant ID</th>
            <th>Tenant</th>
            <th>Type</th>
            <th>User Id</th>
          </tr>
          {loading ? (
            <>Loading...</>
          ) : (
            <tbody>
              {tenants.map((item) => (
                <tr>
                  <td>{item.id}</td>
                  <td>{item.tenant}</td>
                  <td>{item.type}</td>
                  <td>{item.useid}</td>
                  <td>Actions</td>
                </tr>
              ))}
            </tbody>
          )}
        </Table>
      </>
    </div>
  );
}
